import React from "react";
import Navbar from "../../components/Navbar";
import Jumbotron from "../../components/Jumbotron";
import "./style.css";

function Search() {
  return (
    <div>
      <Navbar></Navbar>
      <div className="container">
        <Jumbotron id={`headerSign`}></Jumbotron>
      </div>
    </div>
  );
}

export default Search;
